# Convert 'year_added' to categorical type for plotting
df['year_added'] = df['year_added'].astype(str)

ax = sns.countplot(
    data=df,
    x='year_added',
    palette='viridis',
    edgecolor='black'
)

# Add value labels on top of each bar
for p in ax.patches:
    height = int(p.get_height())
    if height > 0:
        ax.annotate(
            f'{height:,}',
            (p.get_x() + p.get_width() / 2., height),
            ha='center', va='bottom',
            fontsize=10, fontweight='semibold',
            color='black'
        )

# Axis labels and title
plt.xlabel('Year Added to Netflix', fontsize=13, weight='semibold')
