#Top 10 Countries by Number of Titles
plt.figure(figsize=(12,6))
sns.set_style("whitegrid")

# Calculate the top 10 countries
top_countries = df['country'].value_counts().nlargest(10)

ax = sns.barplot(
    x=top_countries.values,
    y=top_countries.index,
    palette='magma',
    edgecolor='black'
)

# Add value labels next to each bar
for i, v in enumerate(top_countries.values):
    ax.text(
        v + max(top_countries.values)*0.01, i,
        f'{v:,}',
        va='center', fontsize=10, fontweight='semibold', color='black'
    )

# Axis labels and title
plt.xlabel('Number of Titles', fontsize=13, weight='semibold')
plt.ylabel('Country', fontsize=13, weight='semibold')
plt.title('Top 10 Countries Producing Netflix Content', fontsize=18, weight='bold')

# Grid and formatting
plt.grid(axis='x', linestyle='--', alpha=0.4)
plt.xticks(fontsize=11)
plt.yticks(fontsize=11)
ax.xaxis.set_major_formatter(plt.FuncFormatter(lambda x, _: f'{int(x):,}'))

plt.tight_layout()
plt.show()

